  const [categories, setCategories] = useState([]);

  const getData = () => {
    axios.get('https://fakestoreapi.com/products/categories')
      .then(response => {
        console.log(response.data);
        setCategories(response.data)
      })
      .catch(error => console.log(error))
  }

